import React from "react";
import { useContext } from 'react';
import { Link } from 'react-router-dom';
import { Segment } from "semantic-ui-react";

function InfoNavBar() {
  return (
    <Segment id="info-navbar" inverted vertical size="tiny">
      <Link id="info" to="/information/how_to_play">
        How To Play
      </Link>

      <Link id="info" to="/information/company_profiles">
        Company Profiles
      </Link>

      <Link id="info" to="/information/leaderboard">
        Leaderboard
      </Link>

      <Link id="info" to="/information/contact">
        Contact
      </Link>
    </Segment>
  );
}

export default InfoNavBar;
